import { useNavigate, useParams } from 'react-router';
import DataState from '../../../Hooks/DataState';
import Navbar from '../../Navbar/Navbar';
import './MyInterview.css';
import { useEffect, useState } from 'react';
import Popup from './Popup/Popup';
import Card from './Card/Card';
import CustomeRoutes from '../../../Routes/CustomRoutes';
import LeftArrow from '../../../assets/angle-circle-arrow-left-icon.png';
import RightArrow from '../../../assets/angle-circle-arrow-right-icon.png';
import axios from "axios";
import server from '../../../environment';

// const data = [
//     { department: "IT", interviewerName: "Vinayak Jadhav", experience: 5, reviewScore: 3.5, thumbnail: "data:image/jpeg;base64," },
//     { department: "Mechanical", interviewerName: "Sanket Patil", experience: 5, reviewScore: 2.5, thumbnail: "data:image/jpeg;base64," },
//     { department: "Computer Science", interviewerName: "Farid Patel ", experience: 5, reviewScore: 4.5, thumbnail: "data:image/jpeg;base64," },
//     { department: "BioTech", interviewerName: "Abhi Khade", experience: 2, reviewScore: 3.0, thumbnail: "data:image/jpeg;base64," },
//     { department: "Civil", interviewerName: "Ran Khot", experience: 4, reviewScore: 4.0, thumbnail: "data:image/jpeg;base64," },
//     { department: "Electronics and Telecommunication", interviewerName: "Pranav Telvekar", experience: 5, reviewScore: 5.0, thumbnail: "data:image/jpeg;base64," }
// ];

const client = axios.create({
    baseURL:`${server}/student`
})

function MyInterview() {

    const navigate = useNavigate(CustomeRoutes);

    const { email } = useParams();
    const [data,setData]=useState([]);


   

    const [ profilePhoto, setProfilePhoto ] = useState(null);
    const [ name, setName ] = useState(null);
    const [ displayPopup, setDisplayPopup ] = useState(false);
    const [ popupID, setPopupID ] = useState("");
    const [ upcomingBtnClick, setUpcomingBtnClick ] = useState(0);
    const [ upcomingPosition, setUpcomingPosition ] = useState(0);
    const [ upcomingMoveCount, setUpcomingMoveCount ] = useState(0);
    const [ historyBtnClick, setHistoryBtnClick ] = useState(0);
    const [ historyPosition, setHistoryPosition ] = useState(0);
    const [ historyMoveCount, setHistoryMoveCount ] = useState(0);
    const [upcomingInterview,setUpcomingInterview] = useState([])
    const [historyInterview,setHistoryInterview] = useState([])

    useEffect( () => {
        // fetch data here.

        let fechData=async()=>{

            //console.log(email)
            let response=await client.get(`/${email}/myinterview`);
            console.log(response.data.myInterviews);
            if(response.data.myInterviews){
                setHistoryInterview(response.data.myInterviews.filter((val)=>val.status=="Completed"))
                setUpcomingInterview(response.data.myInterviews.filter((val)=>val.status=="Pending"))
                setUpcomingMoveCount(response.data.myInterviews.length)
                setHistoryMoveCount(response.data.myInterviews.length)
            }

        }
        fechData()
        setName("Vinayak Sanjay Jadhav");
        setProfilePhoto("data:image/jpeg;base64,");
        setPopupID("4634634634")
    } , [email, profilePhoto, name] )


    function handleReviewClick(id) {
        setDisplayPopup(true);
        setPopupID(id);

    }

    function handleUpcomingLeftMove() {

        if(upcomingBtnClick == 0) return;

        setUpcomingPosition((upcomingPosition) => {
            let position = upcomingPosition + 200;
            const element = document.getElementById("my-interview-upcoming-card");
            element.style.transition = 'transform 0.5s ease-in-out';
            element.style.transform = `translateX(${ position }px)`;
            setUpcomingBtnClick(upcomingBtnClick - 1);
            return position;
        })
        
    }

    function handleUpcomingRightMove() {

        if(upcomingBtnClick >= upcomingMoveCount) return;

        setUpcomingPosition((upcomingPosition) => {
            let position = upcomingPosition - 200;
            const element = document.getElementById("my-interview-upcoming-card");
            element.style.transition = 'transform 0.5s ease-in-out';
            element.style.transform = `translateX(${ position }px)`;
            setUpcomingBtnClick(upcomingBtnClick + 1);
            return position;
        });
    }

    function handleHistoryLeftMove() {

        if(historyBtnClick == 0) return;

        setHistoryPosition((historyPosition) => {
            let position = historyPosition + 200;
            const element = document.getElementById("my-interview-history-card");
            element.style.transition = 'transform 0.5s ease-in-out';
            element.style.transform = `translateX(${ position }px)`;
            setHistoryBtnClick(historyBtnClick - 1);
            return position;
        })
        
    }

    function handleHistoryRightMove() {

        if(historyBtnClick >= historyMoveCount) return;

        setHistoryPosition((historyPosition) => {
            let position = historyPosition - 200;
            const element = document.getElementById("my-interview-history-card");
            element.style.transition = 'transform 0.5s ease-in-out';
            element.style.transform = `translateX(${ position }px)`;
            setHistoryBtnClick(historyBtnClick + 1);
            return position;
            })
    }

   
 

    


    return (
        <DataState.Provider value={ 
            { 
              profilePhoto, setProfilePhoto,
              name, setName
            }
           } >
            <div className="my-interview-wrapper">
                <Navbar />
                <div className="my-interview">
                    <div className="my-interview-upcoming">
                        <h2>Upcoming</h2>
                        <div className="my-interview-upcoming-card" id='my-interview-upcoming-card'>
                        {
                            upcomingInterview.map( (val, index) => {
                                //console.log(val.slot.interviewerId.profileData.category);
                                return <Card key={index} iid={val._id} id={val.slot.interviewerId._id} department={val.slot.interviewerId.profileData.category}  interviewerName={val.slot.interviewerId.name} experience={val.slot.interviewerId.profileData.totalExperience} reviewScore={2.5} thumbnail={val.slot.interviewerId.profileData.profileImage} handleReviewClick={(id) => handleReviewClick(id)}  />
                                
                            } )
                        }
                        </div>
                        <div className="my-interview-move-btns">
                                <button className='my-interview-move-btn' onClick={ () => handleUpcomingLeftMove() } ><img src={ LeftArrow } width={35} height={35} alt="left-arrow" /></button>
                                <button className='my-interview-move-btn' onClick={ () => handleUpcomingRightMove() } ><img src={ RightArrow } width={35} height={35} alt="right-arrow" /></button>
                        </div>
                    </div>
                    <div className="my-interview-history">
                        <h2>History</h2>
                        <div className="my-interview-history-card" id='my-interview-history-card' >
                        {
                            historyInterview.map( (val, index) => {
                                //console.log(val.slot.interviewerId.profileData.category);
                                return <Card key={index} iid={val._id} id={val.slot.interviewerId._id} department={val.slot.interviewerId.profileData.category}  interviewerName={val.slot.interviewerId.name} experience={val.slot.interviewerId.profileData.totalExperience} reviewScore={2.5} thumbnail={val.slot.interviewerId.profileData.profileImage} handleReviewClick={(id) => handleReviewClick(id)}  />
                                
                            } )
                        }
                        </div>
                        <div className="my-interview-move-btns">
                                <button className='my-interview-move-btn' onClick={ () => handleHistoryLeftMove() } ><img src={ LeftArrow } width={35} height={35} alt="left-arrow" /></button>
                                <button className='my-interview-move-btn' onClick={ () => handleHistoryRightMove() } ><img src={ RightArrow } width={35} height={35} alt="right-arrow" /></button>
                        </div>
                        
                    </div>
                    <button id="my-interview-btn" onClick={ () => navigate(`/student/${email}/home/${"department_of_student"}`) } >Back</button>
                </div>
                <Popup id={popupID} displayPopup={displayPopup} setPopupDisplay={setDisplayPopup} />
            </div>
            
        </DataState.Provider>
    );
}


export default MyInterview;